import React from "react";
import Filters from '../Filters'
import './index.css'

export default function Cards (props){
    return (
        <div>
            <Filters/>
            <div className="listado">
                <h1>
                {props.perritos[0]? <span>{props.perritos[0].name}</span>: <span>listado de perritos</span>}
                </h1>
            </div>
        </div>
    )
}
